import { Carousel } from '@trendyol-js/react-carousel';

const ProductCarousel = ({products}) => {
  return (
    <Carousel>
      {products.products.map((product) => (
        <div>
          <img src={product.img}/>
        </div>
      ))}
    </Carousel>
  );
};

export default ProductCarousel;
